function Blog() {
  const [posts, setPosts] = useState([]);
  useEffect( () => {
    client.getEntries().then(function (entries) {
      entries.items.forEach(function (entry) {
        setPosts(...posts, <div>{entry.fields.title}</div>)
      })
    });
  }, [setPosts])

  return (
    <main className="container">
      <h1>Blog</h1>
    </main>
  );
}

export default Blog;
